import React, { Component } from "react";
import "./App.css";
import Egg from "./Egg";

class App extends Component {
  state = {
    nrOfCrackedEggs: 0
  };

  increateCount = () => {
    this.setState({
      nrOfCrackedEggs: this.state.nrOfCrackedEggs++
    });
  };

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1 class="title">Happy easter!</h1>
          <Egg />
        </header>
      </div>
    );
  }
}

export default App;
